// TODO Add a couple lines about each project
const data = [
  {
    title: "Electronic Health Records - Blockchain",
    image:
      "https://thumbor.forbes.com/thumbor/960x0/https%3A%2F%2Fspecials-images.forbesimg.com%2Fdam%2Fimageserve%2F797147020%2F960x0.jpg%3Ffit%3Dscale",
    date: "2021-04-20",
    desc: "Designed and developed a secure system to store and transfer Electronic Health Records over private blockchains using Hyperledger fabric. ",
  },
  {
    title: "Bloom's Taxonomy Classification - Neural Networks",
    image:
      "http://www.juicyenglish.com/uploads/8/2/8/7/82870436/25-c1-blooms-taxonomy_orig.png",
    date: "2015-09-20",
    desc: "Build a classifier to classify questions according to Bloom’s Taxonomy using LSTM. Achieved an accuracy of 96.25%. Built an android app to provide the appropriate interface.",
  },
  {
    title: "Plant Disease Recognitoin",
    // link: "http://www.spacepotato.org",
    image:
      "/images/projects/spacepotatohttps://agfundernews.com/wp-content/uploads/2019/11/Plantix-Day1-03.jpg",
    date: "2015-06-28",
    desc:
      "Launched a potato battery powered weather balloon with two cameras " +
      "and gps transponder. Resulting photos were published in a coffee table book. " +
      "You can email me for a copy.",
  },
  {
    title: "Cat Detector",
    subtitle: "A convolutional neural network to classify cats! (and dogs)",
    image: "/images/projects/catdetector.jpg",
    date: "2015-05-15",
    desc:
      "Trained a convolutional neural network to classify between ~ 80 cats breeds. " +
      "Over 60,000 cats were classified before server bills made the project too expensive " +
      "to continue hosting.",
  },
];

export default data;
